// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";

/**
 * @title DeboxBoxAllocate
 * @author Debox Team
 * @notice Allocate box
 */

contract DeboxBoxAllocate is Ownable {
    using SafeMath for uint256;

    struct BoxMeta {
        address owner;
        uint256 expireTime;
        uint256 saleCnt;
        uint256 tradeCnt;
        uint256 rewards;
    }  

    struct BoxPreOrder {
        uint256 cnt;
        address owner;
        bool allocate;
    } 

    struct BoxAllocate {
        uint256 orderIndex;
        uint256 cnt;
    } 

    struct BoxPrice {
        uint256 boxCnt;
        uint256 price;
    } 

    struct BoxFeeMeta {
        address[] addressArray;
        mapping(address => uint256) addressArrayIndex;
        mapping(address => uint256) boxClaims;
    } 

    uint256 public constant PER_BOX_PRICE = 10**16;
    uint256 public constant PER_BOX_GAS = 10**15;
    uint256 public constant BOX_SALE_PERIOD = 3600*48;
    uint256 public constant BOX_SALE_CNT = 100;
    uint256 public BOX_TRADE_FEE = 10;
    uint256 public BOX_OWNER_FEE = 4;
    uint256 public BOX_PLATFORM_FEE = 2;
    uint256 public BOX_FARM_FEE = 4;

    mapping(address => uint256) public _nonces;
    address public _signOwner = 0x96216849c49358B10257cb55b28eA603c874b05E;
    //meta box balance
    mapping(bytes => mapping(address => uint256)) public _metaBoxBalance;
    mapping(bytes => BoxMeta) private _metaBoxs;
    mapping(bytes => BoxPreOrder[]) private _boxPreOrders;
    mapping(uint256 => uint256) public _boxPrices;
    mapping(bytes => BoxFeeMeta) private _boxFeeMeta;

    address payable public _mutiSign;

    enum TradeType{BUY,SELL}
    enum FeeType{OWNER,PLATFORM,FARM}

    event BoxStart(address indexed sender, string meta, uint256 expireTime);
    event BoxSale(address indexed sender, string meta, uint256 order_index, uint256 box_cnt);
    event BoxTrade(address indexed sender, string meta,uint256 amount,uint256 fees, TradeType trade_type, uint256 box_cnt);
    event BoxAllocateRefund(address indexed sender, string meta, uint256 order_index);
    event DistributeFees(address indexed sender, bytes meta, uint256 fees, FeeType fee_type);
    event BoxClaim(address indexed sender, string meta, uint256 claim_amount);

    constructor() Ownable(msg.sender) {
        _mutiSign = payable(msg.sender);
    }

    modifier callerIsUser() {   
        require(tx.origin == msg.sender, "The caller is another contract");
        _;
    }

    function setMutiSign (address muti_sign) external onlyOwner {
      require(address(0) != muti_sign,"muti_sign is zero addresss");
      _mutiSign = payable(muti_sign);
    }

    function setBoxFee(uint256 owner,uint256 platform,uint256 farm) external onlyOwner {
        BOX_OWNER_FEE = owner;
        BOX_PLATFORM_FEE = platform;
        BOX_FARM_FEE = farm;
        BOX_TRADE_FEE = BOX_OWNER_FEE.add(BOX_PLATFORM_FEE).add(BOX_FARM_FEE);
    }

    function setBoxPrice(BoxPrice[] memory box_prices) external onlyOwner {
        for (uint i = 0; i < box_prices.length; i++) {
            BoxPrice memory box_price = box_prices[i];
            if (box_price.boxCnt > 100 && box_price.price > 0){
                _boxPrices[box_price.boxCnt] = box_price.price;
            }
        }
    }

    function _stringToBytes(string memory source) public pure returns (bytes memory) {
        bytes memory result = bytes(source);
        require(result.length <= 32, "Ths source string exceeds 32 bytes");
        return result;
    }

    function getBoxCnt(string memory meta,address ca) public view returns (uint256) {
        return _metaBoxBalance[_stringToBytes(meta)][ca];
    }

    function getBuyAmount(string memory meta,uint256 cnt) external callerIsUser view returns(uint256,uint256){
        bytes memory metaBytes = _stringToBytes(meta);
        (uint256 tradeTotalAmount,uint256 fee) = calculateBuyAmount(metaBytes,cnt);
        return (tradeTotalAmount,fee);
    }

    function getSellAmount(string memory meta,uint256 cnt) external callerIsUser view returns(uint256,uint256){
        bytes memory metaBytes = _stringToBytes(meta);
        (uint256 tradeTotalAmount,uint256 fee) = calculateSellAmount(metaBytes,cnt);
        return (tradeTotalAmount,fee);
    }

    function startBox(string memory meta, bytes memory signature) external callerIsUser {
        bytes memory metaBytes = _stringToBytes(meta);
        require(_metaBoxs[metaBytes].expireTime == 0, "The meta exist");
        bytes32 message = keccak256(abi.encodePacked(msg.sender, meta, _nonces[_msgSender()]));
        require(ECDSA.recover(message, signature) == _signOwner, "The signature is invalid");
        uint256 expireTime = block.timestamp.add(BOX_SALE_PERIOD);
        _metaBoxs[metaBytes] = BoxMeta({
                owner: msg.sender,
                expireTime: expireTime,
                saleCnt:0,
                tradeCnt:0,
                rewards:0
        });
        emit BoxStart(msg.sender,meta,expireTime);
    }

    function boxPreSale(string memory meta, uint256 box_cnt) external payable callerIsUser returns (bool) {
        bytes memory metaBytes = _stringToBytes(meta);
        require(_metaBoxs[metaBytes].expireTime >= block.timestamp, "The box sale is end");
        require(box_cnt > 0 ,"Box cnt is zero");
        require(box_cnt.mul(PER_BOX_PRICE).add(PER_BOX_GAS) >= msg.value ,"Insufficient Box amount");
        _boxPreOrders[metaBytes].push(BoxPreOrder({
                owner: msg.sender,
                cnt: box_cnt,
                allocate:false
            }));
        _metaBoxs[metaBytes].saleCnt = _metaBoxs[metaBytes].saleCnt.add(box_cnt);
        emit BoxSale(msg.sender,meta,_boxPreOrders[metaBytes].length.sub(1),box_cnt);
        return true;
    }

    function boxAllocate(string memory meta,BoxAllocate[] memory box_allocates) external onlyOwner {
        bytes memory metaBytes = _stringToBytes(meta);
        //require(_metaBoxs[metaBytes].expireTime < block.timestamp, "The box sale in process");
        BoxPreOrder[] storage boxPreOrders = _boxPreOrders[metaBytes];
        if (boxPreOrders.length >= box_allocates.length) {
            for (uint i = 0; i < box_allocates.length; i++) {
                BoxAllocate memory box_allocate = box_allocates[i];
                BoxPreOrder storage boxPreOrder = boxPreOrders[box_allocate.orderIndex];
                if (box_allocate.cnt > 0 && !boxPreOrder.allocate) {
                    require(box_allocate.cnt <= boxPreOrder.cnt,"Insufficient box allocate cnt");
                    boxPreOrder.allocate = true;
                    _metaBoxBalance[metaBytes][boxPreOrder.owner] = _metaBoxBalance[metaBytes][boxPreOrder.owner].add(box_allocate.cnt);
                    pushAddressArray(metaBytes,msg.sender);
                }
                if (boxPreOrder.cnt > box_allocate.cnt ) {
                    uint256 refound = boxPreOrder.cnt.sub(box_allocate.cnt).mul(PER_BOX_PRICE);
                    payable(boxPreOrder.owner).transfer(refound);
                }
                emit BoxAllocateRefund(msg.sender,meta,box_allocate.orderIndex);
            }
        }  
    }

    function boxBuy(string memory meta,uint256 cnt) external payable callerIsUser {
        require(cnt > 0,"Insufficient Box cnt");
        bytes memory metaBytes = _stringToBytes(meta);
        (uint256 tradeTotalAmount, uint256 fee)  = calculateBuyAmount(metaBytes,cnt);
        require(msg.value >= tradeTotalAmount.add(fee),"Insufficient pay amount");
        if (msg.value > tradeTotalAmount.add(fee)) {
            payable(msg.sender).transfer(msg.value.sub(tradeTotalAmount.add(fee)));
        }
        pushAddressArray(metaBytes,msg.sender);
        _metaBoxBalance[metaBytes][msg.sender] = _metaBoxBalance[metaBytes][msg.sender].add(cnt);
        emit BoxTrade(msg.sender,meta,tradeTotalAmount,fee,TradeType.BUY,cnt);
    }

    function boxSell(string memory meta,uint256 cnt) external callerIsUser {
        require(cnt > 0,"Insufficient Box cnt");
        bytes memory metaBytes = _stringToBytes(meta);
        require(_metaBoxBalance[metaBytes][msg.sender] >= cnt,"Insufficient Box balance");
        (uint256 tradeTotalAmount, uint256 fee)  = calculateSellAmount(metaBytes,cnt);
        _metaBoxBalance[metaBytes][msg.sender] = _metaBoxBalance[metaBytes][msg.sender].sub(cnt);
        payable(msg.sender).transfer(tradeTotalAmount.sub(fee));
        emit BoxTrade(msg.sender,meta,tradeTotalAmount,fee,TradeType.SELL,cnt);
    }

    function boxClaim(string memory meta) external callerIsUser {
        bytes memory metaBytes = _stringToBytes(meta);
        uint256 claim = _boxFeeMeta[metaBytes].boxClaims[msg.sender];
        require(claim >= 0,"Insufficient claim amount");
        _boxFeeMeta[metaBytes].boxClaims[msg.sender] = 0;
        payable(msg.sender).transfer(claim);
        emit BoxClaim(msg.sender,meta,claim);
    }

    function calculateBuyAmount(bytes memory metaBytes,uint256 cnt) internal view returns(uint256,uint256){
        require(cnt > 0,"Insufficient Box cnt");
        uint256 tradeTotalAmount = 0;
        uint256 tradeCntBefore = _metaBoxs[metaBytes].tradeCnt;
        for (uint256 i = 0; i < cnt; i++) {
            uint256 tradeCntAfter = tradeCntBefore.add(1);
            uint256 price = PER_BOX_PRICE;
            if (tradeCntAfter > BOX_SALE_CNT) {
                price = _boxPrices[tradeCntAfter];
                if (price <= PER_BOX_PRICE) {
                    price = calculateBoxPrice(tradeCntAfter);
                }
            }
            tradeTotalAmount = tradeTotalAmount.add(price);
            tradeCntBefore = tradeCntAfter;
        }
        uint256 fee = tradeTotalAmount.mul(BOX_TRADE_FEE).div(100);
        return (tradeTotalAmount,fee);
    }

    function calculateSellAmount(bytes memory metaBytes,uint256 cnt) internal view returns(uint256,uint256){
        require(cnt > 0,"Insufficient Box cnt");
        require(_metaBoxBalance[metaBytes][msg.sender] >= cnt,"Insufficient Box balance");
        uint256 tradeTotalAmount = 0;
        uint256 tradeCntBefore = _metaBoxs[metaBytes].tradeCnt;
        for (uint256 i = 0; i < cnt; i++) {
            uint256 tradeCntAfter = tradeCntBefore.sub(1);
            uint256 price = PER_BOX_PRICE;
            if (tradeCntBefore > BOX_SALE_CNT) {
                price = _boxPrices[tradeCntBefore];
                if (price <= PER_BOX_PRICE) {
                    price = calculateBoxPrice(tradeCntBefore);
                }
            }
            tradeTotalAmount = tradeTotalAmount.add(price);
            tradeCntBefore = tradeCntAfter;
        }
        uint256 fee = tradeTotalAmount.mul(BOX_TRADE_FEE).div(100);
        return (tradeTotalAmount,fee);
    }

    function distributeFees(bytes memory metaBytes, uint256 fees) internal {
        BoxMeta storage boxMeta = _metaBoxs[metaBytes];
        if (fees > 0 ) {
            uint256 ownerFees = fees.mul(BOX_OWNER_FEE).div(BOX_TRADE_FEE);
            boxMeta.rewards = boxMeta.rewards.add(ownerFees);
            uint256 FarmAllFees = fees.mul(BOX_FARM_FEE).div(BOX_TRADE_FEE);
            BoxFeeMeta storage boxFeeMeta = _boxFeeMeta[metaBytes];
            address[] memory boxAddressArray = boxFeeMeta.addressArray;
            for (uint256 i = 0; i < boxAddressArray.length; i++) {
                address distributeAddr = boxAddressArray[i];
                uint256 balance = _metaBoxBalance[metaBytes][distributeAddr];
                if (balance > 0 ) {
                   uint256 farmFees = FarmAllFees.mul(balance).div(boxMeta.tradeCnt);
                   boxFeeMeta.boxClaims[distributeAddr] = boxFeeMeta.boxClaims[distributeAddr].add(farmFees);
                   emit DistributeFees(_mutiSign,metaBytes,farmFees,FeeType.FARM);
                }
            }
            uint256 platfromFees = fees.sub(ownerFees).sub(FarmAllFees);
            payable(boxMeta.owner).transfer(ownerFees);
            _mutiSign.transfer(platfromFees);
            emit DistributeFees(_mutiSign,metaBytes,platfromFees,FeeType.PLATFORM);
            emit DistributeFees(_mutiSign,metaBytes,ownerFees,FeeType.OWNER);
        }
    }



    function pushAddressArray (bytes memory metaBytes, address trader) internal  {
        BoxFeeMeta storage boxFeeMeta = _boxFeeMeta[metaBytes];
        uint256 traderIndex = boxFeeMeta.addressArrayIndex[trader];
        if (boxFeeMeta.addressArray[traderIndex] != trader) {
            boxFeeMeta.addressArray.push(msg.sender);
            boxFeeMeta.addressArrayIndex[trader] = boxFeeMeta.addressArray.length.sub(1);
        }
    }

    // 0.0005*x^(1.25)-0.15
    function calculateBoxPrice(uint256 x) public pure returns (uint256) {
        return sqrt(sqrt(x**5)).mul(5).sub(1500).mul(10**14);
    }

    function sqrt(uint256 y) internal pure returns (uint256) {
        if (y == 0 || y == 1) return y;        
        uint256 z = (y + 1) / 2;
        uint256 x = y;
        while (z < x) {
            x = z;
            z = (y / z + z) / 2;
        }
        return x;
    }

}

